import React,{Fragment} from 'react';
import {Link, NavLink} from 'react-router-dom'

const CustomNavBar = () => {
    const guestLinks=(
        <Fragment>
            <li className='nav-item'>
                <NavLink className='nav-link' to='/home' exact>Home</NavLink>
            </li>
            <li className='nav-item'>
                <NavLink className='nav-link' to='/login' exact>Login</NavLink>
            </li>
            <li className='nav-item'>
                <NavLink className='nav-link' to='/register' exact>Register</NavLink>
            </li>
        </Fragment>
        
    );

    return(
        <nav className='navbar navbar-expand-lg bg-body-tertiary'>
            <div className='container-fluid'>
                <Link className='navbar-brand' exact to='/'>DocoApp</Link>
                
                <button 
                    className='navbar-toggler' 
                    type='button' data-bs-toggle='collapse' 
                    data-bs-target='#navbarNav' 
                    aria-controls='navbarNav' 
                    aria-expanded='false' 
                    aria-label='Toggle navigation'
                >
                    <span className='navbar-toggler-icon'></span>
                </button>
                <div className='collapse navbar-collapse' id='navbarNav'>
                    <ul className='navbar-nav'>
                        {guestLinks}
                    </ul>
                </div>
            </div>
        </nav>
    );    
};

export default CustomNavBar;
